import logo from './logo.svg';
import './App.css';

function App() {
  return (

    <div className="App">

      <header className="App-header">
        <div class="wrapper">
          <li class="add-box">
              <div class="icon">
                  <i class="uil uil-file-plus-alt"></i>
              </div>

          </li>

        </div>
      </header>
    </div>
  );
}

export default App;
